def classify_triangle(subtask_id, test_cases):

    def classify_side(l1, l2, l3):
        if l1 == l2 and l2 == l3 and (l3 == l1):
            return 'Isosceles'
        return 'Scalene'

    def classify_angle(l1, l2, l3):
        if l3 == l1 + l2 or l1 == l2 + l3 or l2 == l1 + l3:
            return 'right'
        if l1 < l2 + l3 and l2 < l3 + l1 and (l3 < l2 + l1):
            return 'acute'
        return 'obtuse'
    results = []
    for (x1, y1, x2, y2, x3, y3) in test_cases:
        l1 = (x2 - x1) ** 2 + (y2 - y1) ** 2
        l2 = (x2 - x3) ** 2 + (y2 - y3) ** 2
        l3 = (x3 - x1) ** 2 + (y3 - y1) ** 2
        side_classification = classify_side(l1, l2, l3)
        if subtask_id == 1:
            results.append(f'{side_classification} triangle')
        elif subtask_id == 2:
            angle_classification = classify_angle(l1, l2, l3)
            results.append(f'{side_classification} {angle_classification} triangle')
    return results

